  `user_updt` int(11) NOT NULL,
  `ket_costumer` text NOT NULL,
  `tgl_ins` datetime NOT NULL,
  PRIMARY KEY (`id_member`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

