/*Table structure for table `tb_saldo` */

DROP TABLE IF EXISTS `tb_saldo`;

CREATE TABLE `tb_saldo` (
  `id_saldo` varchar(25) NOT NULL,
  `id_member` varchar(25) DEFAULT NULL,
  `tgl_isi` datetime DEFAULT NULL,
  `kode_resi` varchar(50) DEFAULT NULL,
  `no_rekening` varchar(30) DEFAULT NULL,
  `nama_bank` varchar(30) DEFAULT NULL,
  `nominal` float DEFAULT NULL,
  `tgl_ins` datetime DEFAULT NULL,
  `tgl_updt` datetime DEFAULT NULL,
  `user_updt` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`id_saldo`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

